module.exports = function(RED) {
  function BPLoopNode(n) {
    RED.nodes.createNode(this, n);
    this.loopOver = n.loopOver;
    this.varName=n.varName;
    this.list = n.list;
    this.from = n.from;
    this.skip = n.skip;
    this.to = n.to;
    this.on('input', function(msg) {
    });
  }
  RED.nodes.registerType("loop",BPLoopNode);
}
